import React from 'react'
const foodItems = [
    { id: 1, name: "Margherita Pizza", price: 250, description: "Classic cheese and tomato pizza." },
    { id: 2, name: "Chicken Burger", price: 150, description: "Juicy grilled chicken patty with lettuce and tomato." },
    { id: 3, name: "Pasta Alfredo", price: 200, description: "Creamy Alfredo pasta with mushrooms and parmesan cheese." },
    { id: 4, name: "Caesar Salad", price: 120, description: "Crisp romaine lettuce with Caesar dressing, croutons, and parmesan." },
    { id: 5, name: "Sushi Platter", price: 300, description: "Assorted sushi platter with fresh fish and wasabi." },
];
export default function Menu() {
    return (
        <div className="container mt-4">
            <h2 className="mb-4">Menu</h2>
            <div className="row">
                {foodItems.map(item => (
                    <div className="col-md-4 mb-4" key={item.id}>
                        <div className="card">
                            <div className="card-body">
                                <h5 className="card-title">{item.name}</h5>
                                <p className="card-text">{item.description}</p>
                                <p className="card-text">Price: â‚¹{item.price}</p>
                                <button className="btn btn-primary">Add to Cart</button>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}
